const Pricing = () => {

    return (
        <Wrapper>  
            <Title>Berita Terbaru</Title>
            <Border />
            <ArticleOne>
                <ArticleCard title="Article 1"/>
            </ArticleOne>
            <ArticleTwo>
                <ArticleCard title="Article 1"/>
                <ArticleCard title="Article 1"/>
                <ArticleCard title="Article 1"/>
                <ArticleCard title="Article 1"/>
            </ArticleTwo>
        </Wrapper>
    );
};

export default Pricing;
